INSERT INTO `wp_options` VALUES ('132', '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2016/07/wordpress-4-6-release-candidate/\'>WordPress 4.6 Release Candidate</a> <span class=\"rss-date\">July 27, 2016</span><div class=\"rssSummary\">The release candidate for WordPress 4.6 is now available. Weve made a few refinements since releasing Beta 4 a week ago. RC means we think were done, but with millions of users and thousands of plugins and themes, its possible weve missed something. We hope to ship WordPress 4.6 on Tuesday, August16, but we need [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://poststatus.com/kickstarter-open-source-project/\'>Post Status: Using Kickstarter to fund open source</a></li><li><a class=\'rsswidget\' href=\'https://poststatus.com/scaling-wp-draft/\'>Post Status: Scaling WordPress  Draft Podcast</a></li><li><a class=\'rsswidget\' href=\'http://blog.wordpress.tv/2016/07/28/matt-gibbs-diving-into-commercial-plugin-development/\'>WordPress.tv Blog: Matt Gibbs: Diving Into Commercial Plugin Development</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Popular Plugin:</span> Google Analytics Dashboard for WP&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=google-analytics-dashboard-for-wp&amp;_wpnonce=2b63a17edb&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"Install Google Analytics Dashboard for WP\">(Install)</a></li></ul></div>', 'no');
